{
  "$schema": "https://json-schema.org/draft/2020-12/schema",
  "title": "FloridaLegalProvision2023",
  "description": "Schema for 2023 Florida state statute or administrative code provision with strict version control. Absolutely excludes all 2024 amendments.",
  "type": "object",
  "required": [
    "id",
    "provision_type",
    "citation",
    "summary_description",
    "details",
    "version_control_2023"
  ],
  "properties": {
    "id": {
      "type": "string",
      "format": "uuid",
      "description": "Unique identifier for this 2023 provision record."
    },
    "provision_type": {
      "type": "string",
      "enum": [
        "florida_statute_2023",
        "florida_administrative_code_rule_2023"
      ],
      "description": "Type of Florida legal provision - 2023 version only."
    },
    "citation": {
      "type": "string",
      "minLength": 3,
      "maxLength": 255,
      "description": "The full legal citation as it existed in 2023 (e.g., 'Fla. Stat. ยง 83.49 (2023)')."
    },
    "official_title_2023": {
      "type": "string",
      "maxLength": 500,
      "description": "The official title or catchline of the statute or rule as it existed in 2023."
    },
    "summary_description": {
      "type": "string",
      "minLength": 10,
      "maxLength": 1000,
      "description": "A brief 1-2 sentence summary reflecting the content as it existed in 2023 only."
    },
    "version_control_2023": {
      "type": "object",
      "description": "MANDATORY: Version control verification for 2023 compliance.",
      "required": [
        "verified_2023_version",
        "cutoff_date_compliance",
        "source_verification",
        "exclusion_status"
      ],
      "properties": {
        "verified_2023_version": {
          "type": "boolean",
          "description": "TRUE only if this provision has been verified as the 2023 version."
        },
        "cutoff_date_compliance": {
          "type": "string",
          "pattern": "^2023-12-31$",
          "description": "Must be '2023-12-31' - confirming no post-2023 changes included."
        },
        "source_verification": {
          "type": "object",
          "required": ["source_type", "verification_date"],
          "properties": {
            "source_type": {
              "type": "string",
              "enum": ["official_2023_florida_statutes", "2023_online_sunshine", "2023_legal_database"]
            },
            "source_url_2023": {
              "type": ["string", "null"],
              "description": "URL to 2023-specific source if available."
            },
            "verification_date": {
              "type": "string",
              "format": "date",
              "description": "Date when 2023 version was verified."
            }
          }
        },
        "exclusion_status": {
          "type": "object",
          "required": ["has_2024_amendments", "exclusion_verified"],
          "properties": {
            "has_2024_amendments": {
              "type": "boolean",
              "description": "TRUE if 2024 amendments exist but were excluded."
            },
            "exclusion_verified": {
              "type": "boolean",
              "description": "TRUE if exclusion of 2024 changes has been verified."
            },
            "amendment_summary_excluded": {
              "type": ["string", "null"],
              "maxLength": 500,
              "description": "Brief description of 2024 amendments that were excluded."
            }
          }
        }
      }
    },
    "details": {
      "type": "object",
      "description": "Specific details of the 2023 statute or administrative code rule.",
      "oneOf": [
        { "$ref": "#/definitions/floridaStatuteDetails2023" },
        { "$ref": "#/definitions/floridaAdministrativeCodeRuleDetails2023" }
      ]
    },
    "primary_topic_area": {
      "type": "string",
      "maxLength": 100,
      "description": "Main legal topic area this 2023 provision falls under."
    },
    "keywords_2023": {
      "type": "array",
      "items": {
        "type": "string",
        "maxLength": 50
      },
      "maxItems": 10,
      "description": "Keywords for searching, derived from 2023 title and summary only."
    },
    "application_notes_2023": {
      "type": ["string", "null"],
      "maxLength": 2000,
      "description": "Notes on how this 2023 provision applied - no 2024 updates included."
    },
    "related_provisions_2023": {
      "type": "array",
      "items": {
        "type": "object",
        "properties": {
          "citation_2023": {
            "type": "string",
            "maxLength": 255,
            "description": "Citation of related 2023 provision."
          },
          "relationship_type": {
            "type": "string",
            "enum": [
              "referenced_by_2023",
              "references_2023",
              "complements_2023",
              "clarifies_2023",
              "implements_2023",
              "related_subject_matter_2023",
              "other_2023"
            ]
          }
        },
        "required": ["citation_2023"]
      },
      "maxItems": 20,
      "description": "List of related 2023 Florida statutes only."
    },
    "metadata": {
      "type": "object",
      "description": "Enhanced metadata for 2023 version control.",
      "properties": {
        "schema_version": {
          "type": "string",
          "pattern": "^2\\.0\\.0$",
          "default": "2.0.0",
          "description": "Schema version for 2023-specific requirements."
        },
        "processing_timestamp": {
          "type": "string",
          "format": "date-time",
          "description": "Timestamp of when this 2023 record was generated."
        },
        "source_description": {
          "type": "string",
          "default": "2023 Florida Statutes - version controlled and 2024-exclusion verified.",
          "description": "Origin of the 2023 data for this record."
        },
        "data_integrity_2023": {
          "type": "object",
          "required": ["version_locked", "exclusion_audit_complete"],
          "properties": {
            "version_locked": {
              "type": "boolean",
              "description": "TRUE when 2023 version is locked and verified."
            },
            "exclusion_audit_complete": {
              "type": "boolean",
              "description": "TRUE when 2024 exclusion audit is complete."
            },
            "quality_control_passed": {
              "type": "boolean",
              "description": "TRUE when all 2023 quality controls passed."
            }
          }
        }
      },
      "required": [
        "schema_version",
        "processing_timestamp",
        "data_integrity_2023"
      ]
    }
  },
  "definitions": {
    "floridaStatuteDetails2023": {
      "type": "object",
      "description": "Specific details for a 2023 Florida Statute.",
      "required": [
        "code_name",
        "chapter_number",
        "effective_date_2023",
        "version_as_of_2023"
      ],
      "properties": {
        "code_name": {
          "type": "string",
          "default": "Florida Statutes (2023)",
          "enum": ["Florida Statutes (2023)"],
          "description": "Name of the code - 2023 version."
        },
        "chapter_number": {
          "type": "string",
          "pattern": "^\\d+[A-Z]?$",
          "maxLength": 10,
          "description": "Chapter number as it existed in 2023."
        },
        "chapter_name_2023": {
          "type": ["string", "null"],
          "maxLength": 255,
          "description": "Official name of the Chapter in 2023."
        },
        "section_number_raw_2023": {
          "type": ["string", "null"],
          "maxLength": 50,
          "description": "Section/subsection as it existed in 2023."
        },
        "effective_date_2023": {
          "type": "string",
          "format": "date",
          "description": "REQUIRED: Date when this 2023 version became effective."
        },
        "last_amended_date_pre_2024": {
          "type": ["string", "null"],
          "format": "date",
          "description": "Most recent amendment before 2024 (must be 2023 or earlier)."
        },
        "version_as_of_2023": {
          "type": "string",
          "pattern": "^2023-12-31$",
          "description": "REQUIRED: Must be '2023-12-31' to confirm version control."
        },
        "is_range": {
          "type": "boolean",
          "default": false,
          "description": "True if represents a range of 2023 sections."
        },
        "repealed_status_2023": {
          "type": "boolean",
          "default": false,
          "description": "Whether statute was repealed by end of 2023."
        },
        "post_2023_changes_excluded": {
          "type": "object",
          "required": ["exclusion_verified"],
          "properties": {
            "exclusion_verified": {
              "type": "boolean",
              "description": "TRUE if post-2023 changes were identified and excluded."
            },
            "excluded_changes_summary": {
              "type": ["string", "null"],
              "maxLength": 500,
              "description": "Summary of 2024+ changes that were excluded."
            }
          }
        }
      }
    },
    "floridaAdministrativeCodeRuleDetails2023": {
      "type": "object",
      "description": "Specific details for a 2023 Florida Administrative Code Rule.",
      "required": [
        "code_name",
        "rule_number_full",
        "effective_date_2023",
        "version_as_of_2023"
      ],
      "properties": {
        "code_name": {
          "type": "string",
          "default": "Florida Administrative Code (2023)",
          "enum": ["Florida Administrative Code (2023)"],
          "description": "Name of the code - 2023 version."
        },
        "rule_number_full": {
          "type": "string",
          "pattern": "^\\d+[A-Z]?-\\d+\\.\\d+$",
          "maxLength": 20,
          "description": "Full rule number as it existed in 2023."
        },
        "effective_date_2023": {
          "type": "string",
          "format": "date",
          "description": "REQUIRED: Date when this 2023 version became effective."
        },
        "last_amended_date_pre_2024": {
          "type": ["string", "null"],
          "format": "date",
          "description": "Most recent amendment before 2024."
        },
        "version_as_of_2023": {
          "type": "string",
          "pattern": "^2023-12-31$",
          "description": "REQUIRED: Must be '2023-12-31' to confirm version control."
        },
        "repealed_status_2023": {
          "type": "boolean",
          "default": false,
          "description": "Whether rule was repealed by end of 2023."
        },
        "post_2023_changes_excluded": {
          "type": "object",
          "required": ["exclusion_verified"],
          "properties": {
            "exclusion_verified": {
              "type": "boolean",
              "description": "TRUE if post-2023 changes were identified and excluded."
            },
            "excluded_changes_summary": {
              "type": ["string", "null"],
              "maxLength": 500,
              "description": "Summary of 2024+ changes that were excluded."
            }
          }
        }
      }
    }
  }
}
